import React from "react";
import './Login.scss';


const Login = props => {
    return (
        <div>
            <div>
                <div></div>
                <form>
                    <input type="text"/>
                    <input type="password" />
                    <button>로그인</button>
                </form>
            </div>
            <div>
                <p>계정이 없으신가요?</p>
                <a>가입하기</a>
            </div>
        </div>
    );
};

export default Login;
